translation.t:
Voit lisätä dynaamisia arvoja, jotka tulevat tilalle viipaloinnin aikana.

Lämpötilat:
{TEMP0}, {TEMP1}
{BED}

Nopeudet:
{Z_TRAVEL_SPEED}
{TRAVEL_SPEED}

Voit myös lisätä rivin vain, jos pursotinta tai lämpöalustaa on käytetty. Siis lisää yksi näistä koodeista rivin alkuun:
{IF_BED}
{IF_EXT0}

Käytä "Luo oletus" saadaksesi hyvän alun skriptillesi, voit muokata tarpeitasi vastaavaksi.
